import React, { useState, useEffect } from 'react';
import indexStyles from './index.module.css';
import styles from './resultWindow.module.css';

export default function ResultWindow({ data, nextPage }) {

  return (
    <div className={"full_size"}>

      <div>Попаданий:<div>{data.cntHits}</div></div>
      <div>Промахов:<div>{data.propsmissClick}</div></div>
      <div>Точность:<div>{data.accuracyOfHits}</div>%</div>
      <div>Скорость реакции:<div>{data.speedOfHits}</div>мс</div>


      <button className={indexStyles.btn} onClick={nextPage}>Restart</button>
    </div>
  );
}
